// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/// @title 분산형 RPG 게임 스마트 컨트랙트 (Decentralized RPG)
/// @author 
/// @notice 이 컨트랙트는 플레이어가 캐릭터를 생성하고, 훈련(레벨업)하거나 아이템을 구매하여 능력치를 강화할 수 있는 기능을 제공합니다.
contract DecentralizedRPG {
    // ------------------------------------------------------------------------
    // 1. 구조체 정의
    // ------------------------------------------------------------------------

    /// @notice 플레이어 캐릭터 정보
    struct Character {
        string name;      // 캐릭터 이름(닉네임)
        uint256 level;    // 캐릭터 레벨
        uint256 hp;       // 체력 (Health Points)
        uint256 atk;      // 공격력 (Attack)
        uint256 def;      // 방어력 (Defense)
        uint256 exp;      // 경험치 (Experience Points) - 향후 확장용
        bool exists;      // 캐릭터 생성 여부 확인용
    }

    /// @notice 게임 내 아이템 정보
    struct Item {
        uint256 id;             // 아이템 고유 ID
        string name;            // 아이템 이름
        uint256 atkBoost;       // 공격력 증가량
        uint256 defBoost;       // 방어력 증가량
        uint256 price;          // 가격(wei 단위)
        bool exists;            // 아이템 등록 여부 확인용
    }

    // ------------------------------------------------------------------------
    // 2. 상태 변수(State Variables)
    // ------------------------------------------------------------------------

    /// @notice 캐릭터 소유자를 기준으로 매핑 (계정 주소 → Character)
    mapping(address => Character) public characters;

    /// @notice 아이템 ID를 기준으로 매핑 (아이템 ID → Item)
    mapping(uint256 => Item) public items;

    /// @notice 새로운 아이템 ID를 발급하기 위한 카운터
    uint256 public nextItemId;

    /// @notice 컨트랙트 관리자 (오너) 주소
    address public owner;

    // ------------------------------------------------------------------------
    // 3. 이벤트 정의
    // ------------------------------------------------------------------------

    /// @notice 캐릭터가 생성될 때 발생
    event CharacterCreated(address indexed player, string name);

    /// @notice 캐릭터가 훈련하여 레벨업할 때 발생
    event CharacterLeveledUp(address indexed player, uint256 newLevel);

    /// @notice 아이템이 구매될 때 발생
    event ItemPurchased(address indexed player, uint256 itemId, string itemName);

    /// @notice 새로운 아이템이 등록될 때 발생
    event ItemAdded(uint256 indexed itemId, string name, uint256 price);

    /// @notice 아이템 정보가 수정될 때 발생
    event ItemUpdated(uint256 indexed itemId, string name, uint256 price);

    // ------------------------------------------------------------------------
    // 4. 생성자(Constructor)
    // ------------------------------------------------------------------------

    constructor() {
        owner = msg.sender;
        nextItemId = 1;   // 1부터 아이템 ID 시작
    }

    // ------------------------------------------------------------------------
    // 5. 모디파이어(Modifiers)
    // ------------------------------------------------------------------------

    /// @notice 오직 오너만 실행할 수 있도록 제한
    modifier onlyOwner() {
        require(msg.sender == owner, "Caller is not the owner.");
        _;
    }

    /// @notice 캐릭터가 이미 생성되었는지 확인
    modifier characterExists() {
        require(characters[msg.sender].exists, "Character does not exist.");
        _;
    }

    /// @notice 캐릭터가 생성되지 않은 상태인지 확인
    modifier characterNotExists() {
        require(!characters[msg.sender].exists, "Character already exists.");
        _;
    }

    /// @notice 유효한 아이템인지(등록된 아이템인지) 확인
    modifier validItem(uint256 _itemId) {
        require(items[_itemId].exists, "Item does not exist.");
        _;
    }

    // ------------------------------------------------------------------------
    // 6. 캐릭터 관련 함수
    // ------------------------------------------------------------------------

    /// @notice 새로운 캐릭터를 생성합니다.
    /// @param _name 생성할 캐릭터의 이름(닉네임)
    function createCharacter(string calldata _name) external characterNotExists {
        // 초기 능력치 설정 (예시)
        uint256 initialLevel = 1;
        uint256 initialHp = 100;
        uint256 initialAtk = 10;
        uint256 initialDef = 5;

        characters[msg.sender] = Character({
            name: _name,
            level: initialLevel,
            hp: initialHp,
            atk: initialAtk,
            def: initialDef,
            exp: 0,
            exists: true
        });

        emit CharacterCreated(msg.sender, _name);
    }

    /// @notice 캐릭터 정보 조회 (배열이 아닌 매핑으로 public 선언했으므로 getter가 자동 생성됨)
    /// @notice 내 캐릭터의 기본 정보를 조회합니다.
    /// @return name  캐릭터의 이름 (닉네임)
    /// @return level 캐릭터의 레벨
    /// @return hp    캐릭터의 체력(HP)
    /// @return atk   캐릭터의 공격력(ATK)
    /// @return def   캐릭터의 방어력(DEF)
    /// @return exp   캐릭터의 현재 경험치(EXP)
    function getMyCharacter()
        external
        view
        characterExists
        returns (
            string memory name,
            uint256 level,
            uint256 hp,
            uint256 atk,
            uint256 def,
            uint256 exp
        )
    {
        Character memory c = characters[msg.sender];
        return (c.name, c.level, c.hp, c.atk, c.def, c.exp);
    }

    /// @notice 캐릭터를 훈련하여 레벨업합니다. 일정량의 Ether를 지불해야 합니다.
    /// @dev 레벨업당 고정 비용(예: 0.01 ETH)을 요구하도록 설정
    function train() external payable characterExists {
        // 훈련(레벨업) 비용 설정 (0.01 ETH)
        uint256 levelUpCost = 0.01 ether;
        require(msg.value >= levelUpCost, "Insufficient ETH for training.");

        // 현재 캐릭터 정보 불러오기
        Character storage c = characters[msg.sender];

        // 레벨업 로직: 레벨 증가, 능력치 강화
        c.level += 1;
        c.hp += 20;    // 레벨업당 체력 +20
        c.atk += 5;    // 레벨업당 공격력 +5
        c.def += 3;    // 레벨업당 방어력 +3
        c.exp = 0;     // 경험치는 초기화 (향후 확장 시 사용 가능)

        emit CharacterLeveledUp(msg.sender, c.level);

        // 초과 ETH 환불 (만약 있다면)
        if (msg.value > levelUpCost) {
            payable(msg.sender).transfer(msg.value - levelUpCost);
        }
    }

    // ------------------------------------------------------------------------
    // 7. 아이템 상점 관련 함수
    // ------------------------------------------------------------------------

    /// @notice 새로운 아이템을 등록합니다. 오너만 호출 가능합니다.
    /// @param _name 아이템 이름
    /// @param _atkBoost 아이템이 제공하는 공격력 증가량
    /// @param _defBoost 아이템이 제공하는 방어력 증가량
    /// @param _price 아이템 가격(wei 단위)
    function addItem(
        string calldata _name,
        uint256 _atkBoost,
        uint256 _defBoost,
        uint256 _price
    ) external onlyOwner {
        uint256 itemId = nextItemId;
        items[itemId] = Item({
            id: itemId,
            name: _name,
            atkBoost: _atkBoost,
            defBoost: _defBoost,
            price: _price,
            exists: true
        });

        nextItemId += 1;

        emit ItemAdded(itemId, _name, _price);
    }

    /// @notice 기존 아이템 정보를 수정합니다. 오너만 호출 가능합니다.
    /// @param _itemId 수정할 아이템 ID
    /// @param _name 새로운 아이템 이름
    /// @param _atkBoost 새로운 공격력 증가량
    /// @param _defBoost 새로운 방어력 증가량
    /// @param _price 새로운 가격(wei 단위)
    function updateItem(
        uint256 _itemId,
        string calldata _name,
        uint256 _atkBoost,
        uint256 _defBoost,
        uint256 _price
    ) external onlyOwner validItem(_itemId) {
        items[_itemId].name = _name;
        items[_itemId].atkBoost = _atkBoost;
        items[_itemId].defBoost = _defBoost;
        items[_itemId].price = _price;

        emit ItemUpdated(_itemId, _name, _price);
    }

    /// @notice 등록된 아이템 목록을 조회합니다.
    /// @dev 배열 리턴은 가스비가 높으므로, 프론트엔드에서 ID만 가져간 뒤 개별 조회할 것을 권장합니다.
    function getItem(uint256 _itemId)
        external
        view
        validItem(_itemId)
        returns (
            uint256 id,
            string memory name,
            uint256 atkBoost,
            uint256 defBoost,
            uint256 price
        )
    {
        Item memory it = items[_itemId];
        return (it.id, it.name, it.atkBoost, it.defBoost, it.price);
    }

    /// @notice 특정 아이템을 구매하여 캐릭터의 능력치를 강화합니다.
    /// @param _itemId 구매할 아이템 ID
    function purchaseItem(uint256 _itemId) external payable characterExists validItem(_itemId) {
        Item memory it = items[_itemId];

        // 적절한 가격을 지불했는지 확인
        require(msg.value >= it.price, "Insufficient ETH to purchase item.");

        Character storage c = characters[msg.sender];

        // 아이템 효과 적용
        c.atk += it.atkBoost;
        c.def += it.defBoost;
        // 필요하다면 HP에도 영향을 주도록 개선 가능

        emit ItemPurchased(msg.sender, _itemId, it.name);

        // 초과 ETH 환불
        if (msg.value > it.price) {
            payable(msg.sender).transfer(msg.value - it.price);
        }
    }

    // ------------------------------------------------------------------------
    // 8. 관리자(오너)용 자금 인출 기능
    // ------------------------------------------------------------------------

    /// @notice 컨트랙트에 누적된 이더를 오너가 인출합니다.
    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to withdraw.");
        payable(owner).transfer(balance);
    }
}

